import React from "react"
import dynamic from 'next/dynamic'
const { Document, Page } = dynamic(() => import('@react-pdf/renderer'), {ssr:false})


class Test extends React.Component {
  render() {
    return (
      <Document
        file={{
          url: "/src/pdf/CV-Developer.pdf"
        }}
        onLoadError={e =>
          console.log("Error while loading document! " + e.message)
        }
        onSourceError={e =>
          console.log("Error while loading document! " + e.message)
        }
      >
        <Page pageNumber={1} />
      </Document>
    );
  }
}

const Resume = () => {
  return (
    <div>
      <Test></Test>
    </div>
  );
};

export default Resume
